import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { FillintheblankComponent } from 'src/app/layout/fillintheblank/fillintheblank.component';

const routes: Routes = [
  {
    path: '', component:FillintheblankComponent
  }
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class FillintheblankRoutingModule { }
